import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Button from 'react-bootstrap/Button';
import MenuComponent from '../General/MenuComponent';
import FooterComponent from '../General/FooterComponent';

const FamilyAreaComponent = () => {

    return (
        <div>
            <MenuComponent/>
            <Jumbotron>

                <p>
                    <span>
                          <Button href="/family/create" variant="secondary">Add Family</Button>
                        <br/>
                    </span>
                    <span>
                        <br/>
                           <Button href="/family/list"  variant="secondary">List Families</Button>
                    </span>
                </p>
                <p>
                </p>
            </Jumbotron>
            <FooterComponent/>

        </div>
    )
};

export default FamilyAreaComponent;
